import React from "react";
import WithCard from "components/container/withCard";
import { fetchUsers } from "api/db-init";
import { Button } from "semantic-ui-react";
import { Link } from "react-router-dom";

type Props = {
  env: string;
};

export default class Saved extends React.Component<Props> {
  state = {
    users: ["berk", "akgün"],
  };

  async componentDidMount() {
    const users = await fetchUsers(this.props.env);
    this.setState({ users });
  }
  render() {
    return (
      <div>
        {this.state.users ? (
          this.state.users.map(() => <WithCard />)
        ) : (
          <React.Fragment>
            <h1>There is no saved user</h1>
            <Button color="green">
              Go to Home
              <Link to="/sign-up" />
            </Button>
          </React.Fragment>
        )}
      </div>
    );
  }
}
